script: |
  super -f text -I q9890.spq | sort > q9890.out

inputs:
  - name: q9890.spq
    data: |
      SELECT DISTINCT - + col2 FROM tab1 (FORMAT parquet) cor0 WHERE ( + 1 - + - ( - + col2 ) ) < 27 * + - 39 * + - 63 * + + 84 + - 8;
  - name: tab1

outputs:
  - name: q9890.out
    data: |
      -59
      -68
      -96
